648f61363b4dea253b8b00","message":"Use the expressions before CSE as cache keys\n\nThis will be faster, and it seems significantly so.","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/d6bbfb271692b91ea9648f61363b4dea253b8b00"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"4434891ba7287b2c74c9f76493d814be5dda8601","message":"Make condition trees right-associative\n\nThis should help CSE.\nThis is dangerous though, because various optimizations\nassume that condition trees are left-associative. I hope I change all\ncases.","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/4434891ba7287b2c74c9f76493d814be5dda8601"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"cc088ce87ae63447860d91653e87a8e1de117521","message":"CSE: reuse definitions from enclosing scopes\n\nThis finally allows CSE to work across operands of &&.","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/cc088ce87ae63447860d91653e87a8e1de117521"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"548f4580320132a5106b44f0b5ed5e3a740cc802","message":"SIC_INNER_SHOULD_BE_STATIC_ANON: remove one letExp usage\n\nI verified that CSE makes this unnecessary.","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/548f4580320132a5106b44f0b5ed5e3a740cc802"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"9338b20b5774dc6c8ac13b10436bbc11f08aeb7f","message":"Consolidate letTransformer{Trivial,UsedAtMostOnce} as selectiveLetInliner","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/9338b20b5774dc6c8ac13b10436bbc11f08aeb7f"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"0f121e20715a8d9127f992372f2e7744ce5ae0fc","message":"Add TODOs on transformations to implement","distinct":false,"url":"https://api.github.com/repo