os/ps-mr/LinqOnSteroids/commits/1f0e4822fe9e364447548412159d1e358d3c4a18"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"19c8d65852da7840ccca2f8c177fd4e77864e982","message":"Move object Const inside Exp (mostly unchanged)","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/19c8d65852da7840ccca2f8c177fd4e77864e982"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"a9cb0ade94b601bee6bf48bc8c74ae280aadc715","message":"Install new definitions of Exp/Def/etc.\n\nCompilations now breaks","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/a9cb0ade94b601bee6bf48bc8c74ae280aadc715"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"c712b6bc8342001c71fa1ca4d4808fa6bccc4796","message":"Start adapting code to rearchitecturing\n\nThis commits essentially replaces Exp by Def whenever appropriate,\nand starts inserting calls to Sym in the few pattern matches left in.\n\nMoreover, I needed to fix some return types in tupleSupport - they declared to\nreturn not Exp but a concrete subclass (which was stupid before and broken now).\n\nIn some cases (in tupleSupport), I need to add more type parameters to help type\ninference (the alternative would be to call an implicit conversion by name).\n\nThe code compiles with a set of other hacky changes which I'll commit\nnext.","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/c712b6bc8342001c71fa1ca4d4808fa6bccc4796"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"b5c6fe579763b48926e35bb839433fb7cff8208d","message":"Hacky fixes for compilation\n\nNow the code compiles again!","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/b5c6fe579763b48926e35bb839433fb7cff8208d"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"8f397752538ae95264635071930efa5f919998be","message":"Fix the transformation API\n\nImplicit conversions don't work well enough - they can't be triggered\nin exp transform {case ...} because the type for the anonymous function\nflows from the caller, but Scalac does not figure the right caller\n(the implicit conversion) without first figuring the type of the\nanonymous function.","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/8f397752538ae95264635071930efa5f919998be"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"e709e452952bf0e79ede3ed06b97b93e449455a2","message":"Reintroduce Compile...\n\n... and reenable clients, e.g. IfInstanceOf (by reverting part of\n7e2eb18688dacc06df9908d430f8f56e1f5814c6)","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/e709e452952bf0e79ede3ed06b97b93e449455a2"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"cc06dc5cc1d4d7db36122b3bd3ec5e7a2f8dfe9c","message":"Style fix","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/cc06dc5cc1d4d7db36122b3bd3ec5e7a2f8dfe9c"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"1ffa36e41984a0cf66dc97b6de74cff0bb21789c","message":"Move back Benchmarking and MemoryUsage\n\nThey need no adaptation, luckily.","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/1ffa36e41984a0cf66dc97b6de74cff0bb21789c"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"caf4521416603dc40fe27e00064786f6013e5f56","message":"Break compilation dependency\n\nCompile should _not_ depend on Benchmarking.","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/caf4521416603dc40fe27e00064786f6013e5f56"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"79d23208f81de4b87aedd4b8e4a69de0fe4dd267","message":"Cleanup","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/79d23208f81de4b87aedd4b8e4a69de0fe4dd267"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"e6da1ea4ffc430e40b8d0956c1fdc14a9051f8df","message":"Introduce FunSym\n\nThis will be used for expression nodes which currently contain Fun.\nNote that it must have the same variance as Fun.","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/e6da1ea4ffc430e40b8d0956c1fdc14a9051f8df"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"2add2199e44f0d10049d3aeeb9453d075ef99e89","message":"Rename","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/2add2199e44f0d10049d3aeeb9453d075ef99e89"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"310847b44f1051eb913c40b64931427830b76269","message":"Reenable clients of Fun using FunSym","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/310847b44f1051eb913c40b64931427830b76269"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"df58e897877cbdc8bcb3ec7aa81bf530c209df83","message":"Move back lifting for collections\n\nUnfortunately I had to move back in all this code at once, since it's\ninterconnected.\nAlso here, in many cases, I had to add boilerplate (type parameters) to help\ntype inference.\nIn other cases, I had used a concrete class instead of Exp as return type in\nsome public methods; fix this.","distinct":false,"url":"https://api.github.com/repos/ps-mr/LinqOnSteroids/commits/df58e897877cbdc8bcb3ec7aa81bf530c209df83"},{"author":{"email":"p.giarrusso@gmail.com","name":"Paolo G. Giarrusso"},"sha":"4991dbcf94a774d852de00c88cae128e47ce2918","message":"Reenable SampleWrapperGenerator\n\nAnd with this, I essentially finished reverting the hacks in\nb5c6fe579763b48926e35bb839433fb7cff8208d - the only remaining change\nis Exp.toCode, but maybe that should stay in after all.","distinct":false,"url":"https://api.github.com/rep